import React, { FC } from 'react';
import styles from './AddEmployee.module.scss';
import {useForm} from 'react-hook-form';
import Employee from '../../../../../../models/Employee';

interface AddEmployeeProps {}

const AddEmployee: FC<AddEmployeeProps> = () => {

  const {register,handleSubmit, formState} = useForm<Employee>();

  return(
    <div className={styles.AddEmployee}>
      <form className='form-group'>
        <label>שם פרטי:</label><br />
        <input className='form-control' type="text" {...register('firstName')} />
        <label>שם משפחה:</label><br />
        <input className='form-control' type="text" {...register('lastName')} />
        <label>תפקיד:</label><br />
        <input className='form-control' type="text" {...register('title')} />
        <label>עיר מגורים:</label><br />
        <input className='form-control' type="text" {...register('city')} />
        <label>מדינה:</label><br />
        <input className='form-control' type="text" {...register('country')} />
        <label>תאריך לידה</label><br />
        <input className='form-control' type="date" {...register('birthDate')} />
        <label>תמונה:</label>
        <input className='form-control' type="file" {...register('imageName')} /><br />
        <button>הוסף</button>
      </form>
    </div>
  );
}

export default AddEmployee;
